import React from "react";
import styled from "styled-components";


const WeatherDiv = styled.div `
display: flex;
flex-direction: column;

`;


function Api(props) {
  return (
    <>
    <WeatherDiv>
      <h1>Lancaster, PA</h1>
      <h4>{props.weather.LocalObservationDateTime}</h4>
      <p>{props.weather.WeatherText}</p>
      <p><span>Temperature: </span>{props.temperature.Value}<span>° Fahrenheit</span></p>
      <p><span>Real Feel: </span>{props.realFeel.Value}<span>° Fahrenheit</span></p>
      <p><span>Humidity: </span>{props.weather.RelativeHumidity}</p>
    </WeatherDiv>
    </>
  );
}

export default Api;
